PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "campaigns" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar, "description" text, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "campcounts" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "campaign_id" integer, "country_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "campplays" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "campaign_id" integer, "player_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "counties" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar, "description" text, "state_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "countries" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar, "description" text, "size" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "player" reference);
CREATE TABLE "neighborhoods" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "neighbor_id" integer, "target_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "players" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "screenname" varchar, "motto" varchar, "country_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "states" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar, "description" text, "country_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "level" integer);
CREATE TABLE "userplays" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "player_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "user_id" integer);
CREATE TABLE "users" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "email" varchar DEFAULT '' NOT NULL, "encrypted_password" varchar DEFAULT '' NOT NULL, "reset_password_token" varchar, "reset_password_sent_at" datetime, "remember_created_at" datetime, "sign_in_count" integer DEFAULT 0 NOT NULL, "current_sign_in_at" datetime, "last_sign_in_at" datetime, "current_sign_in_ip" varchar, "last_sign_in_ip" varchar, "name" varchar);
CREATE TABLE "schema_migrations" ("version" varchar NOT NULL PRIMARY KEY);
CREATE TABLE "ar_internal_metadata" ("key" varchar NOT NULL PRIMARY KEY, "value" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "index_campcounts_on_campaign_id_and_country_id" ON "campcounts" ("campaign_id", "country_id");
CREATE INDEX "index_campcounts_on_campaign_id" ON "campcounts" ("campaign_id");
CREATE INDEX "index_campcounts_on_country_id" ON "campcounts" ("country_id");
CREATE INDEX "index_campplays_on_campaign_id" ON "campplays" ("campaign_id");
CREATE INDEX "index_campplays_on_player_id" ON "campplays" ("player_id");
CREATE INDEX "index_neighborhoods_on_neighbor_id" ON "neighborhoods" ("neighbor_id");
CREATE UNIQUE INDEX "index_Neighborhoods_on_target_id_and_neighbor_id" ON "neighborhoods" ("target_id", "neighbor_id");
CREATE INDEX "index_neighborhoods_on_target_id" ON "neighborhoods" ("target_id");
CREATE INDEX "index_players_on_country_id" ON "players" ("country_id");
CREATE INDEX "index_states_on_country_id" ON "states" ("country_id");
CREATE INDEX "index_userplays_on_player_id" ON "userplays" ("player_id");
CREATE INDEX "index_userplays_on_user_id" ON "userplays" ("user_id");
CREATE UNIQUE INDEX "index_users_on_email" ON "users" ("email");
CREATE UNIQUE INDEX "index_users_on_reset_password_token" ON "users" ("reset_password_token");
COMMIT;
